  */

const Loading = () => {
  return (
    <div className="loadingInPopup">
      <lottie-player
        style={{ height: "250px", width: "250px" }}
        src="./assets/cocktail.json"
        background="transparent"
        speed="10"
        loop
        autoplay
      ></lottie-player>
    </div>
  );
};

/*
